import { Component, OnInit } from '@angular/core';
import { Customer } from '../model/Customer';
import { CustomerService } from '../service/customer.service';
import { Router } from '@angular/router';
import { User } from '../model/User';

@Component({
  selector: 'app-update',
  templateUrl: './update.component.html',
  styleUrls: ['./update.component.css']
})
export class UpdateComponent implements OnInit {


  customId: string="";
  customer: U={};
  filteredCustomers: User[] = [];

  constructor(private myService:CustomerService,private router :Router) { }

  ngOnInit(): void {
    this.getEmployeeById();
  }
  getEmployeeById() {
    this.customId = this.myService.customeId;

    this.myService.getCustomers().subscribe((data) => {
      this.filteredCustomers = data.filter((res: User) => {
        return res.userId === this.customId;
      });

      if (this.filteredCustomers.length > 0) {
        this.customer = this.filteredCustomers[0];
      }
    console.log(this.customer);

    });
  }

  function1(){
    this.myService.updateCustomer(this.customer).subscribe();
    alert("updated the record successfully üíØ")
    this.router.navigate(['home'])


  }
}

<div class="container">
    <div class="row">
        <div class="col-md-6">
            <div class="card">
                <div class="text-center">
                    <h1>Update Your Customer</h1>
                    <h5>‚ù§Ô∏è Hiiiiii Admin ‚ù§Ô∏è</h5>
                </div>
                <hr>
                <form  (submit)="function1()">

                    <div class="mb-3">
                        <label class="form-label">user ID</label>
                        <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="uuid" [(ngModel)]="customer.uuid" placeholder="enter your pizza id " >
                    </div>
                    <div class="mb-3">
                        <label class="form-label">first Image</label>
                        <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="first_name" [(ngModel)]="customer.first_name" >
                    </div>

                    <div class="mb-3">
                        <label class="form-label">last Name</label>
                        <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="last_name" [(ngModel)]="customer.last_name" >

                    </div>

                    <div class="mb-3">
                        <label class="form-label">street</label>
                        <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="street" [(ngModel)]="customer.street" >

                    </div>
                    <div class="mb-3">
                        <label class="form-label">address</label>
                        <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" name="address" [(ngModel)]="customer.address" >

                    </div>

                    <div class="mb-3">
                        <label class="form-label">city</label>
                        <input type="text" class="form-control" id="exampleInputPassword1" name="city" [(ngModel)]="customer.city" >
                    </div>
                    <div class="mb-3">
                        <label class="form-label">state</label>
                        <input type="text" class="form-control" id="exampleInputPassword1" name="state" [(ngModel)]="customer.state" >
                    </div>
                    <div class="mb-3">
                        <label class="form-label">email</label>
                        <input type="text" class="form-control" id="exampleInputPassword1" name="email" [(ngModel)]="customer.email" >
                    </div>
                    <div class="mb-3">
                        <label class="form-label">phone</label>
                        <input type="text" class="form-control" id="exampleInputPassword1" name="phone" [(ngModel)]="customer.phone" >
                    </div>


                    <button type="submit" class="btn btn-primary">update</button>

                </form>
                <a routerLink="/home">N0 Need to update go back!!</a>

            </div>
        </div>
    </div>
</div>
